import './Dashboard.css'
import React, { useEffect, useState } from 'react'
import { useNavigate, Outlet, Link, useLocation, } from 'react-router-dom'
import axios from 'axios'
import { useTheme } from '@mui/material/styles'
import Navbar from './Navbar'
import Note from './Note'
function Dashboard() {
  const theme = useTheme()
  let location = useLocation()
  const navigate = useNavigate()
  const [Notes, setNotes] = useState()
  const verifyUser = async () => {
    try {
      const response = await axios.get('/api/dashboard/', {
        withCredentials: true,
      })
      if (response?.status === 200) {
        setNotes(response?.data?.notes)
        console.log('printing resonse', response?.data?.notes)
      }
    } catch (err) {
      console.log('error from dashboard js file', err)
      navigate('/login')
    }
  }

  useEffect(() => {
    verifyUser()
  }, [])

  return (
    <>
      <Navbar />
       
      <div className='notes-wrapper'>
        {Notes &&
          Notes.map((note) => {
            return (
              <Link
                key={note._id}
                to={`/api/dashboard/${note._id}`}
                state={{ background: location }}
              >
                <main
                  key={note._id}
                  style={{ padding: '1rem', border: '1px solid red',height:'100px', width:'100px' }}
                >
                  <h4>Title: {note.title}</h4>
                  <h4>Body: {note.body}</h4>
                  {/* <Note note={note} /> */}
                </main>
              </Link>
            )
          })}
        <hr />
        aqdr
        {/* <div style={{height:'150px' ,width:'150px' ,borderRadius:"10px", display:'flex', justifyContent:'center', border:'10px solid red'}}> */}
        {/* </div> */}
      </div>
        <Outlet />
    </>
  )
}

export default Dashboard
